import React, { useContext } from 'react';
import { Col, Container, ListGroup, Row } from 'react-bootstrap';
import { Context } from '..';
import Note from './Note';

const List = () => {

    const note = useContext(Context)

    return (
        <Container>
            <Row className="mt-3">
                <Col md={12}>
                    <ListGroup>
                        {note.notes.map(note => <Note note={note} />)}
                    </ListGroup>
                </Col>
            </Row>
        </Container>
    );
};

export default List;
